import React, { useState, useEffect } from 'react';
import axios from 'axios';

function FondoPensionList() {
  const [fondos, setFondos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchFondos = async () => {
      try {
        const response = await axios.get('/api/fondos-pension');
        setFondos(response.data);
        setLoading(false);
      } catch (err) {
        setError('Error al cargar los fondos de pensión');
        setLoading(false);
      }
    };

    fetchFondos();
  }, []);

  if (loading) return <div>Cargando...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div>
      <h2>Lista de Fondos de Pensión</h2>
      <table>
        <thead>
          <tr>
            <th>ID Fondo</th>
            <th>Nombre Fondo</th>
            <th>Producto Fondo</th>
            <th>Porcentaje Seguro</th>
          </tr>
        </thead>
        <tbody>
          {fondos.map((fondo) => (
            <tr key={fondo.id}>
              <td>{fondo.fields.id_fondo}</td>
              <td>{fondo.fields.nom_fondo}</td>
              <td>{fondo.fields.pdct_fondo}</td>
              <td>{fondo.fields.pct_seguro}%</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FondoPensionList;
